import React from "react";
import styled from "styled-components";

const DeleteBox = styled.div`
  width: 50%;
  height: 300px;
  background-color: #f2f2f2;
`;

function Delete() {
  return <DeleteBox></DeleteBox>;
}

export default Delete;
